import React from 'react';
import './BitcoinRate.css';


class BitcoinRate extends React.Component {
  constructor(props){
    super(props);
  }
  displayBitcoinRate(){
    if(this.props.currency != ''){
      return '1B = ' + this.props.setExchangeRate + ' ' + this.props.currency;
    }

  }

  render(){
    return(
      <div id="display-div">
      <TextField
        id="standard-read-only-input"
        label="Read Only"
        defaultValue="Hello World"
        InputProps={{
          readOnly: true,
        }}
      />
      </div>
    );
  }
}
